import styled from 'styled-components';

const Tag = (value) => styled.span`
display:block;
padding:0.5em;
position:relative;
float:left;
vertical-align:middle;
background-color: #e4e4e4;
color: #787878;
border-radius: 10px;
margin-right:0.5em;
text-align:center;
grid-column-end: span ${value};
`
const Index = (props) => {
    return <Tag value={props.value}>{props.children}</Tag>; 
};
export default Index;
